Position Description:Novetta is seeking a Machine Learning Engineer to contribute to the modeling process from problem definition, through data pipeline and model implementation; applying agile methods to ML development activities. They will work as part of a multi-disciplinary team and will impact multiple projects concurrently.
DoD is shifting investment into the future of machine learning and artificial intelligence across the Defense Intelligence Enterprise to reimagine and revolutionize the intelligence process. In order to achieve this, Training Quality Data (TQD) must be harvested from current data holdings, data gaps must be characterized into targeting/collection requirements and synthetic data must be generated.
Responsibilities:Identify important and interesting questions surrounding our customer's challenges, then translate those questions into concrete analytical tasks;
Develop strategies to extract, resolve, and unify information of various types from numerous data sources;
Organize and mine massive data sets of both structured and unstructured data;
Provide thought-leadership in the areas of machine learning, artificial intelligence, analytics and data science;
Work with a diverse team of engineers, computer scientists, data scientist and analysts.
Basic Qualifications:Academic degree in a relevant field (e.g., Computer Science, Engineering, Mathematics, Statistics, Operations Research, Physics, etc.);
Detailed experience with open source frameworks for Neural Network architectures including Keras, TensorFlow, PyTorch, or Caffe;
Detailed experience and understanding of Machine Learning methods and frameworks including ensemble methods
Experience implementing various types of Neural Networks including Convolutional Neural Networks and/or Recurrent Neural Networks
Desired Skills:Experience with intelligence analysis mission sets.
Familiarity with network analysis, natural language processing, and/or risk modeling.
Experience with FMA programs, analyzing supply chain data, or processing real time data feeds to produce actionable results.
Security Clearance:Must have an active US Government Secret security clearance.
